import './index.css';
import React from "react";

function TodoMenu() {
  return (
    <nav className="todoNav">
      <div className='todoNameSpan'>TODOS |</div>
      <ul className="todoNav-list">
        <li className="todoNav-list__item">Active</li>
        <li className="todoNav-list__item">Completed</li>
        <li className="todoNav-list__item">All</li>
      </ul>
    </nav>
  );
}

export { TodoMenu };
